(function() {
	// Array of extension URLs to automatically load and load unsandboxed
	const autoload = [
		// source: foreverif.js from
		// https://github.com/TurboWarp/extensions/issues/1162#issuecomment-1825973449
		// Arduino S1
		"data:application/javascript;base64,",
	];
	
	// Make the editor load the autoload extensions unsandboxed and don't ask to load
	const oldCanLoad = vm.securityManager.canLoadExtensionFromProject;
	vm.securityManager.oldCanLoad = async (url) => {
		if (autoload.includes(url)) return "unsandboxed";
		return await oldCanLoad(url);
	};
	const oldGetSandboxMode = vm.securityManager.getSandboxMode;
	vm.securityManager.getSandboxMode = (url) => {
		if (autoload.includes(url)) return "unsandboxed";
		return oldGetSandboxMode(url);
	};
	
	// Actually load the extensions
	// (as far as I'm aware extensions never unload in TurboWarp so this should be fine???)
	for (const url of autoload) {
		vm.extensionManager.loadExtensionURL(url);
	}
})();